import React from "react";
import { Table, TableBody, TableCell, TableContainer, TableHead, TableRow, Paper, TextField } from "@mui/material";
import { calculateCurrent } from "../utils/calculateCurrent";

export default function VITable({ data, setData, diodeType, mode }) {

  const handleChange = (index, newVoltage) => {
    const newData = [...data];
    const V = parseFloat(newVoltage);
    const I = calculateCurrent(V, diodeType, mode);
    newData[index] = { voltage: V, current: Number(I.toFixed(6)) };
    setData(newData);
  };

  return (
    <TableContainer component={Paper} sx={{ borderRadius: 2 }}>
      <Table>
        <TableHead>
          <TableRow>
            <TableCell><b>Voltage (V)</b></TableCell>
            <TableCell><b>Current (A)</b></TableCell>
          </TableRow>
        </TableHead>

        <TableBody>
          {data.map((row, index) => (
            <TableRow key={index}>
              <TableCell>
                <TextField
                  variant="outlined"
                  size="small"
                  value={row.voltage}
                  onChange={(e) => handleChange(index, e.target.value)}
                  sx={{ width: "100px" }}
                />
              </TableCell>
              <TableCell>{row.current}</TableCell>
            </TableRow>
          ))}
        </TableBody>

      </Table>
    </TableContainer>
  );
}
